import React from 'react';
import { 
  styled,
  Box,
  Grid,
} from '@mui/material';
import Header from '../components/Templates/Header/Header';
import Footer from '../components/Templates/Footer';
import ShopItems from '../components/CategoryItems';
import MainBanner from '../components/Other'


const Body = styled(Box)(() => ({
  backgroundColor: '#1E1D1B',
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'center',
}));



export default function FullWidthGrid() {

  return (
    <Box>
      <Grid container>
        <Grid item xs={12}>
          <Header />
        </Grid>
        <Grid xs={12}>
          <Body>
            <MainBanner/>
            <ShopItems/>
          </Body>  
        </Grid>
        <Grid item xs={12}>
          <Footer />
        </Grid>
      </Grid>
    </Box>
  );
}
